import React,{Component} from "react";
import "../css/public.css";
import UngroupedItem from "./UngroupedItem";

class UngroupedList extends Component{
    constructor() {
        super();
    }
    render() {
        const {list,toggleDoneItem} = this.props;
        return(
            <div>
                <span>未分组任务:</span>
                <ul>
                    {
                        list.map( item => {
                            return (
                                <UngroupedItem
                                    key={item.id}
                                    {...item}
                                    toggleDoneItem = {toggleDoneItem}
                                />
                            );
                        })
                    }
                </ul>
            </div>
        );
    }
}
export default UngroupedList;
